import React, { useState } from "react";
import Confetti from "react-confetti";

function Confett() {
  const [confetti, setConfetti] = useState(false);
  setTimeout(() => setConfetti(true), 5000);

  return <Confetti run={confetti} />;
}

export default Confett;
